import React from 'react';

import './App.css';
import Onboarding from './components/Onboarding';
import Login from './components/Login';
import Splash from './components/Splash';
import{
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useParams,
  Redirect
} from 'react-router-dom';

function App() {
  return (
    <div className>
      <header className>

        <Router>

          <Switch>
          <Route path ="/splash"><Splash></Splash></Route>
            <Route path="/onboarding"><Onboarding></Onboarding></Route>

            <Route path ="/login"><Login></Login></Route>


          </Switch>
        </Router>

      </header>
    </div>
  );
}

export default App;
